import React from 'react';

const Ways = () => {
    return (
        <>
            <h1>Ways to work with us</h1>
            <Card title="Project Management" />
            <Card title="Advanced Analytics" />
            <Card title="Marketing & Dashboard" />
        </>
    );
};

export default Ways;
